import React, { Component } from 'react'

export class DisplayPanel extends Component {
    constructor(props){
        super(props);
        this.onDataChange = this.onDataChange.bind(this);
    }

   

  render() {
    return (
        <>
        {/* {this.onDataChange()} */}
      <div>DisplayPanel</div>
      {
        
        this.props.data.map(image=>(
          <>
            <p>image</p>
            {/* <img>image</img> */}
          </>
        ))
      }
      </>
    )
  }
}

export default DisplayPanel
